const About: React.FC = () => {
    return (
        <React.Fragment>
            <Cover>
                <Banner 
                title="About us"
                subtitle="The story of us"
                >
                    <article>
                        <h5>As one of the hotels which aims to provide better services to customers, we are impletmentig technologies which makes everything easier for you. </h5>
                    </article>
                <Link to="/rooms" className="btn-primary">our rooms</Link>
                </Banner>
            </Cover>
            <FeaturedRooms />
        </React.Fragment>
    )
}

export default About
